import re

def string_check(s, min_len, max_len):
    if len(s) < min_len and len(s) > max_len:
        return False
    for i in range(2, len(s) // 2 + 1):
        pattern = '(.{%d}).*\\1' % i
        if re.search(pattern, s):
            return False
    return len(set(s.split()))

